INSERT INTO `cook` (`id`, `user_id`, `food_name`, `element`, `making`, `image`) VALUES
(1, 5, 'Thịt kho tàu', ' Thịt ba chỉ 1 1/2 kg\r\n Trứng vịt 10 quả\r\n Hành tím 4 củ\r\n Nước dừa 2 trái\r\n Tỏi(băm) 1 muỗng cà phê\r\n Ớt 5 trái\r\n Nước mắm 4 muỗng canh\r\n Nước màu 1/2 muỗng cà phê\r\n Đường trắng 1 muỗng cà phê\r\n Bột ngọt 1/2 muỗng cà phê\r\n Dầu ăn 3 muỗng canh', 'Chuẩn bị\r\nBước 1\r\nThịt rửa sạch, để ráo nước, thái miếng to, vuông khoảng 4-5cm.\r\n\r\nBước 2\r\nƯớp một 2 muỗng canh nước mắm, bột ngọt, 1/2 muỗng cà phê đường vào thịt cho thấm. Hành tím cắt lát.\r\n\r\nBước 3\r\nTrứng vịt luộc chín bóc vỏ, cắt đôi.\r\n\r\nThực hiện\r\nBước 1\r\nBắc nồi lên bếp phi thơm tỏi, cho thịt vào xào săn lại. Cho hành tím, nước màu, 2 muỗng canh nước mắm, 1/2 muỗng cà phê đường vào cùng.\r\n\r\nBước 2\r\nKhi thịt sôi lên, đổ nước dừa vào nồi. Tiếp đến cho trứng vịt đã cắt vào, thêm ớt trái. Đun nhỏ lửa.\r\n\r\nBước 3\r\nThịt mềm tắt bếp, múc ra ăn kèm với cơm trắng rất ngon đấy.', );
INSERT INTO `cook` (`id`, `user_id`, `food_name`, `element`, `making`, `image`) VALUES
(2, 1, 'Trứng cuộn cơm chiên Hàn Quốc', ' Hành tây 1/2 củ\r\n Cà rốt 1 củ\r\n Thịt bò 30 gr\r\n Dầu ăn 2 muỗng canh\r\n Cơm 2 chén\r\n Trứng gà 4 quả\r\n Muối 1/2 muỗng cà phê\r\n Tiêu 1/2 muỗng cà phê\r\n Sốt cà chua 2 muỗng canh\r\n Hành lá 1 cây\r\n Nước tương 1 muỗng canh', 'Thực hiện\r\nBước 1\r\nRửa sạch, cắt nhỏ hành lá, hành tây và cà rốt. Thịt bò băm nhỏ (bạn có thể thay bằng thịt lợn, gà, tôm nếu thích).\r\n\r\nBước 2\r\nĐun nóng hai muỗng canh dầu. Sau đó cho hành tây, cà rốt, hành lá, thịt bò vào xào đến khi chín. Nêm nếm 1/2 muỗng cà phê muối, 1 muỗng canh nước tương, 1/2 muỗng cà phê tiêu vừa ăn.\r\n\r\nBước 3\r\nGiảm lửa xuống mức trung bình. Cho cơm vào, đảo đều đến khi hạt cơm tách rời nhau. Thêm 1 đến 2 muỗng canh nước sốt cà chua, tiếp tục đảo cho đến khi sốt hòa quyện vào cơm.\r\n\r\nBước 4\r\nĐập 2 quả trứng vào chén, đánh tan rồi chiên vàng trên chảo. Giảm nhỏ lửa, cho hỗn hợp cơm chiên vào giữa rồi gấp hai bên của trứng vào giữa cho khít vào nhau. Lật lại mặt sau để trứng chín đều.\r\n\r\nBước 5\r\nTrình bày món ăn ra đĩa, thêm nước sốt cà chua lên trên để bắt mắt hơn. Món trứng cuộn cơm chiên có thể ăn kèm cũng với salad hoặc dưa leo để cho đỡ bị ngấy.', );
INSERT INTO `cook` (`id`, `user_id`, `food_name`, `element`, `making`, `image`) VALUES
(3, 5, 'Trứng hấp thịt', ' Trứng gà 4 quả\r\n Thịt heo bằm 100 gr\r\n Dầu ăn 1 muỗng canh\r\n Nước tương 1 muỗng canh\r\n Hành lá 1/2 cây\r\n Muối 1 muỗng cà phê', 'Thực hiện\r\nBước 1\r\nĐập trứng gà vào bát, dùng đũa đánh tan cùng với 1-2 muỗng cà phê muối. Thêm nước lạnh vào trứng, lượng nước bằng khoảng ½ lượng trứng. Lọc trứng qua rây sau đó cho vào khay.\r\n\r\nBước 2\r\nDùng màng bọc thực phẩm bọc kín trứng lại và cho vào nồi hấp chín. Trong lúc đó, bắc chảo lên bếp cùng chút dầu ăn và cho thịt xay vào xào thơm cùng với 1 muỗng canh nước tương.\r\n\r\nBước 3\r\nSau khoảng 6 phút hấp trứng, mở màng bọc thực phẩm ra và cho thịt băm lên trên, đậy nắp lại và nấu thêm khoảng 2 phút thì lấy ra, rắc hành cắt nhỏ và thưởng thức!', );
INSERT INTO `cook` (`id`, `user_id`, `food_name`, `element`, `making`, `image`) VALUES
(4, 5, 'Gà rang muối', ' Thịt gà 600 gr\r\n Trứng gà 1 quả\r\n Lá chanh 5 lá\r\n Sả 3 củ\r\n Bột năng 3 muỗng canh\r\n Tiêu 1 muỗng cà phê\r\n Nước mắm 2 muỗng canh\r\n Dầu ăn 3 muỗng canh\r\n Hạt nêm 1 muỗng cà phê\r\n Muối 5 muỗng canh\r\n Bột ngọt 2 muỗng canh\r\n Tiêu 2 muỗng cà phê(Trắng)', 'Chuẩn bị\r\nBước 1\r\nƯớp gà với chút hạt nêm, nước mắm, hạt nêm, tiêu, dầu ăn và lòng đỏ trứng. Bọc kín bằng nilon bọc thức ăn, cất tủ lạnh ít nhất 30 phút, khi nào bắt đầu ăn thì bỏ ra chế biến.\r\n\r\nBước 2\r\nSả cắt khúc dài chừng 3 đốt ngón tay rồi lấy dao nhọn tước ra thành dạng sợi. Lá chanh thái sợi.\r\n\r\nBước 3\r\nMuối giả để rang gà: muối rang sơ qua để nguội thêm bột ngọt và tiêu sọ trộn đều rồi đem giã nhỏ.\r\n\r\nThực hiện\r\nBước 1\r\nChuẩn bị một nồi nhỏ để chiên gà. Cho lần lượt sả và lá chanh vào dầu ăn lúc dầu đang nóng, chiên đến khi vàng rồi vớt riêng ra đĩa.\r\n\r\nBước 2\r\nDùng chính chỗ dầu ăn trong nồi đó để chiên gà. Lăn gà đã ướp ở trên qua bột năng, thả vào nồi dầu nóng.\r\n\r\nBước 3\r\nChiên đến khi gà xém vàng thì vớt ra đĩa (không quá 1 phút). Lần lượt chiên 4-5 miếng trong một mẻ. Không chiên lâu quá vì gà sẽ bị khô bên trong.\r\n\r\nBước 4\r\nSau khi đã chiên xong gà, cho tất cả gà vào chảo khô sạch (không dính chút dầu mỡ nào), xóc đều gà với muối giả (khoảng 3 muỗng canh) và sả, lá chanh đã chiên vàng.\r\n\r\nBước 5\r\nCho gà rang muối ra đĩa, ăn nóng. Chấm với muối tiêu chanh và chút ớt tươi nhé!', );
INSERT INTO `cook` (`id`, `user_id`, `food_name`, `element`, `making`, `image`) VALUES
(5, 5, 'Thịt kho bơ đậu phộng', ' Thịt heo(Bụng) 100 gr\r\n Thịt heo bằm 100 gr\r\n Nước 200 ml\r\n Cơm 1 chén\r\n Nấm đông cô 3 cái\r\n Hành tím 2 củ\r\n Tỏi 2 tép\r\n Trứng gà 2 quả\r\n Nước tương(Đặc) 3 muỗng canh\r\n Hắc xì dầu 3 muỗng canh\r\n Rượu trắng 2 muỗng canh\r\n Đường phèn 2 muỗng canh\r\n Tiêu 1/4 muỗng cà phê\r\n Bơ đậu phộng 1 muỗng canh\r\n Dầu ăn 2 muỗng canh', 'Thực hiện\r\nBước 1\r\nĐun sôi nồi nước, cho miếng thịt heo vào luộc trong 3 phút hoặc cho đến khi chín tái. Vớt ra, để ráo nước rồi tiến hành xắt hạt lựu. Đặt chảo lên bếp, thêm một ít dầu, thêm thịt heo xay, thịt heo xắt nhỏ vào xào cho đến khi chín.\r\n\r\nBước 2\r\nTrứng luộc chín. Nấm tươi rửa sạch, cắt nhỏ. Hành tím, tỏi bóc vỏ, thái nhỏ. Thêm nấm tươi, tỏi và hành băm vào xào cùng. Thêm rượu trắng, đường, nước, hắc xì dầu, nước tương đặc và trứng đã luộc chín, bóc vỏ vào nồi đun sôi.\r\n\r\nBước 3\r\nThêm hạt tiêu xay và bơ đậu phộng nấu cho đến khi nước đặc lại như nước sốt. Múc hỗn hợp thịt heo vừa nấu vào chén cơm trắng nóng và thưởng thức.\r\n\r\nBước 4\r\nMón thịt heo kho bơ đậu phộng thơm ngon khi ăn cùng cơm trắng. Món thịt kho beo béo, mặn mặn và thơm phức hương bơ và nước tương thật đưa cơm luôn đấy!', );
INSERT INTO `cook` (`id`, `user_id`, `food_name`, `element`, `making`, `image`) VALUES
(6, 1, 'Bánh mì gà nướng nhân phô mai', ' Gà (Xay)350 gr\r\n Nấm mỡ 3 cái\r\n Hành tây 1/4 củ\r\n Phô mai(Viên) 12 viên\r\n Phô mai(Bào) 2 muỗng canh\r\n Bánh mì(Vụn) 3 muỗng canh\r\n Dầu olive 2 muỗng canh\r\n Tỏi băm 1 muỗng cà phê\r\n Giấm 1/2 muỗng canh\r\n Muối 1 muỗng cà phê\r\n Tiêu 1 muỗng cà phê\r\n Trứng gà 1 quả', 'Thực hiện\r\nBước 1\r\nLàm nóng lò nướng ở 200 độ C, xịt lớp bơ chống dính lên từng khuôn bánh cupcake. Nấm và hành tây xắt nhỏ. Hỗn hợp A: Cho dầu olive, 1 muỗng canh phô mai bào, 1 muỗng canh vụn bánh mì vào tô, trộn đều.\r\n\r\nBước 2\r\nLàm vỏ bánh mì: Trong tô thịt gà băm nhỏ, cho thêm nấm xắt nhỏ, hành tây xắt nhỏ, phô mai bào còn lại, vụn bánh mì còn lại, tỏi băm, trứng, muối và hạt tiêu đen vào, trộn đều thành hỗn hợp. Dùng muỗng múc từng muỗng hỗn hợp, viên tròn rồi cho vào từng khuôn tròn. Dàn đều hỗn hợp về phía thành khuôn để tạo thành khoảng trống vừa đủ đặt 2 viên phô mai.\r\n\r\nBước 3\r\nTiếp tục múc hỗn hợp vỏ bánh lấp đầy khoảng trống, che phủ toàn bộ viên phô mai. Rắc nguyên liệu đã tạo thành ở Hỗn hợp A lên trên cùng. Cho khay vào lò nướng đã bật sẵn, nướng trong khoảng 20-25 phút hoặc cho đến khi thấy bề mặt bánh chuyển màu vàng nâu là bánh chín.\r\n\r\nBước 4\r\nMón bánh mì gà nướng nhân phô mai theo kiểu phương Tây đã hoàn thành. Chúc bạn thành công với món bánh mới lạ này.\r\n\r\nBước 5\r\nMón bánh mì gà nướng nhân phô mai theo kiểu phương Tây đã hoàn thành. Chúc bạn thành công với món bánh mới lạ này.', );
INSERT INTO `cook` (`id`, `user_id`, `food_name`, `element`, `making`, `image`) VALUES
(7, 4, 'Canh hành tây cà rốt', ' Thịt heo 50 gr\r\n Cà rốt 1/2 củ\r\n Hành tây 1/2 củ\r\n Tỏi 2 tép\r\n Tiêu 1/2 muỗng cà phê\r\n Muối 1/2 muỗng cà phê\r\n Hạt nêm 1/2 muỗng cà phê\r\n Nước 1 lít\r\n Nước mắm 1/2 muỗng cà phê\r\n Dầu ăn 1 muỗng cà phê', 'Thực hiện\r\nBước 1\r\nCà rốt rửa sạch, gọt vỏ, thái sợi. Hành tây bóc vỏ, thái sợi. Tỏi băm nhỏ. Thịt heo thái mỏng, ướp nước mắm, tiêu, muối, hạt nêm. Cho nồi lên bếp, thêm dầu ăn vào, chờ dầu nóng cho tỏi băm vào phi thơm rồi trút thịt vào xào. Cho nước vào với lượng vừa ăn, chờ nước sôi thì lần lượt thêm cà rốt, hành tây vào, chờ nước sôi lại thì nêm nếm lại cho vừa ăn và tắt bếp.\r\n\r\nBước 2\r\nMúc canh ra tô thêm hành lá tuỳ thích, dùng nóng. Có những ngày vừa mưa vừa lạnh, bạn lười biếng và chẳng muốn ra khỏi nhà, đi chợ. Hãy tìm những rau củ còn lại trong tủ lạnh và nấu với chút thịt là bạn đã có ngay món canh đầy sắc màu ngọt ngon hấp dẫn này rồi!', );
INSERT INTO `cook` (`id`, `user_id`, `food_name`, `element`, `making`, `image`) VALUES
(8, 4, 'Bánh cuốn ngọt', ' Bột năng 150 gr\r\n Bột gạo 100 gr\r\n Đậu xanh 100 gr\r\n Dừa nạo 50 gr\r\n Đường vàng 200 gr\r\n Mè đen 1 muỗng cà phê\r\n(Rang)\r\n Nước 800 ml', 'Thực hiện\r\nBước 1\r\nĐậu xanh ngâm nước khoảng 3-4 tiếng cho nở mềm. Hòa tan 150gr đường với 800ml nước. Trộn đều bột năng và bột gạo trong một tô to. Đổ từ từ nước đường vào tô bột, khuấy đều cho bột tan hết. Lọc bột qua rây cho bột mịn. Cho đậu xanh vào nồi, đổ nước vào đun cho đậu xanh chín mềm.\r\n\r\nBước 2\r\nKhi đậu xanh chín mềm, đổ 50gr đường còn lại vào dừa nạo rồi đảo đều cho đường tan hết. Cho chảo chống dính lên bếp, đổ một muỗng bột vào chảo rồi nghiêng nhẹ chảo để bột thật mỏng. Đậy vung khoảng 1 phút, khi mở ra bột chuyển trong là được.\r\n\r\nBước 3\r\nLấy bánh ra khỏi chảo, múc một thìa nhân đậu xanh vào rồi gói lại như gói nem (chả giò). Gói lần lượt cho đến khi hết nhân, khi ăn bạn rắc thêm mè đen rang cho thơm.\r\n\r\nBước 4\r\nBánh cuốn ngọt có lớp vỏ hơi dai dai, lớp nhân bùi bùi của đỗ xanh và ngọt béo của dừa tươi. Đây là món bánh khá dân dã, cách làm đơn giản nhưng khi thưởng thức thì bất cứ ai đều sẽ cảm thấy cực kì thích thú.', );
INSERT INTO `cook` (`id`, `user_id`, `food_name`, `element`, `making`, `image`) VALUES
(9, 5, 'Vịt kho gừng tươi', ' Thịt vịt 500 gr\r\n Gừng 1 củ\r\n Tỏi 1 củ\r\n Nước mắm 1 muỗng canh\r\n Tiêu 1 muỗng cà phê\r\n Nước màu 1 muỗng canh\r\n Hạt nêm 2 muỗng cà phê\r\n Dầu ăn 1 muỗng canh', 'Chuẩn bị\r\nBước 1\r\nVịt mua về rửa sạch, chặt miếng vừa ăn. Tỏi bóc vỏ, băm nhỏ. Gừng cạo vỏ, cắt sợi.\r\n\r\nBước 2\r\nƯớp thịt với 2 muỗng cà phê hạt nêm, 1 muỗng cà phê tiêu, đảo đều, để thịt ngấm gia vị trong vòng 15-20 phút.\r\nVịt kho gừng tươi\r\n\r\nThực hiện\r\nBước 1\r\nĐun nóng 1 muỗng canh dầu ăn, cho tỏi băm nhỏ vào phi thơm. Trút thịt vịt đã ướp ở trên vào cùng với gừng, để lửa to đảo nhanh tay trong vòng 2 phút.\r\n\r\nBước 2\r\nCho 1 muỗng canh nước màu và 1 muỗng canh nước mắm vào thịt, hạ lửa nhỏ dần. Đun thêm 15 phút cho tới khi nước cạn bớt, thịt mềm vừa ăn, có màu vàng đẹp thì tắt bếp.\r\n\r\nBước 3\r\nMúc thịt vịt kho gừng ra đĩa, dùng nóng với cơm trắng.', );
INSERT INTO `cook` (`id`, `user_id`, `food_name`, `element`, `making`, `image`) VALUES
(10, 5, 'Bánh cuốn tôm', ' Bột gạo 100 gr\r\n Bột bắp 10 gr\r\n Tôm tươi 200 gr\r\n Muối 1/2 muỗng cà phê\r\n Dầu ăn 3 muỗng canh\r\n Rượu trắng 1 muỗng canh\r\n Gừng băm 1 muỗng cà phê\r\n Nước tương 2 muỗng canh\r\n Tỏi băm 1/2 muỗng cà phê\r\n', 'Chuẩn bị\r\nBước 1\r\nTôm bóc vỏ, lấy chỉ đen, thêm chút nước cùng 1/4 muỗng cà phê muối, 1/2 muỗng cà phê tiêu, 1/2 muỗng cà phê gừng băm ngâm trong khoảng nửa giờ.\r\n\r\nBước 2\r\nTrộn 100g bột gạo và 10g bột bắp cùng 1/4 muỗng cà phê muối với nước vừa đủ và để nguyên trong vòng 20 phút.\r\nBánh cuốn tôm\r\n\r\nThực hiện\r\nBước 1\r\nLấy một chiếc chảo nhỏ và đổ từ từ lớp bột gạo lên trên. Chú ý xoay đều chảo để bột phủ đều bề mặt chảo tạo thành lớp bột mỏng.\r\n\r\nBước 2\r\nĐem đi hấp trong nồi nước sôi khoảng 2 phút. Khi bột chín, dễ dàng nhấc miếng bột ra ngoài mà không sợ rách.\r\n\r\nBước 3\r\nĐặt tôm vào miếng bột, thêm 1 ít hành lá cắt nhỏ, 1 ít gừng băm, 1 ít tỏi băm và cuộn lại.\r\n Tránh nhồi quá nhiều nhân tôm kẻo miếng bánh bị rách.\r\n\r\nBước 4\r\nXếp bánh lên đĩa và hấp trong vòng 3 phút. Có thể cắt đôi miếng bánh, rưới nước tương và ăn kèm rau luộc.', );
INSERT INTO `cook` (`id`, `user_id`, `food_name`, `element`, `making`, `image`) VALUES
(11, 5, 'Tôm kho tàu', ' Tôm tươi 500 gr\r\n(Càng xanh)\r\n Dừa 1 trái\r\n Hành lá 2 nhánh\r\n Tỏi băm 1 muỗng canh\r\n Dầu điều 2 muỗng cà phê\r\n Nước mắm 1 muỗng canh\r\n(Nước)\r\n Dầu ăn 2 muỗng canh\r\n Đường trắng 2 muỗng cà phê\r\n Bột ngọt 1/2 muỗng cà phê\r\n Tiêu 2/3 muỗng cà phê\r\n Muối 1/3 muỗng cà phê\r\n', 'Thực hiện\r\nBước 1\r\nTôm rửa sạch, bóc vỏ, giữ lại phần đuôi để khi chiên nhìn cho đẹp mắt. Sau đó bạn tiếp tục lấy gạch tôm bỏ riêng ra chén, rút bỏ chỉ lưng. Hành lá nhặt bỏ lá úa, rửa sạch thái nhỏ phần lá xanh, còn lại phần đầu trắng thì đập dập, băm nhuyễn. Chanh cắt đôi.\r\n\r\nBước 2\r\nRửa sạch chảo, cho chảo lên bếp đợi khô thì cho 2 muỗng canh dầu vào chảo, cho tôm vào chiên. Khi tôm săn, ngả màu thì cho ra tô. Tôm vừa chiên ở bước 1 bạn đem ướp với phần đầu hành lá băm nhuyễn, 1/2 muỗng cà phê bột ngọt, 1 muỗng cà phê đường, 1/3 muỗng cà phê muối, 1/3 muỗng cà phê tiêu, tỏi băm, trộn đều lên cho tôm ngấm gia vị. Trong chén gạch tôm thêm vào 1 muỗng canh nước mắm, 1 muỗng cà phê nước chanh, 1 muỗng cà phê đường, 2 muỗng cà phê dầu điều, 1/3 muỗng cà phê tiêu. Rửa sạch chảo rồi cho chảo lên bếp, cho nước vào rồi đặt cả bát gạch tôm vào chảo chưng cách thủy. Sau đó, rưới phần gạch tôm vào phần tôm đang ướp.\r\n\r\nBước 3\r\nĐặt chảo lên bếp, cho tôm vào kho, cho nước dừa vào. Cuối cùng khi gần tắt bếp thì bạn cho chút tiêu và hành lá.\r\n\r\nBước 4\r\nVới những nguyên liệu đơn giản, dễ tìm, các chị đã có thể làm ngay món Tôm kho tàu có vị mặn và thơm đặc trưng của nước mắm, khiến cho cả nhà phải ăn cơm liên tục. Nếu chán với những món thịt nhiều dầu mỡ thì hãy đổi vị cho cả nhà với món ngon này nhé!', );

